  location_name: location_name
  description: A study in montane and subalpine forests that investigated how variation
    in snow-gum tissue traits and environmental conditions correlated with elevation-dependent
    spatial patterns of forest mortality.
  basis_of_record: field
  life_stage: adult
  sampling_strategy: Study site, subspecies and longitudinal climate trends ^p This
    study was conducted within Kosciuszko National Park (KNP), New South Wales (NSW)
    (148.358, -36.431; Figure 1a). In KNP, Eucalyptus pauciflora subsp. pauciflora
    occurs in pure and mixed stands up to ~1550 m; above ~1650 m, E. pauciflora subsp.
    niphophila occurs in pure stands, with subspecies distinguishable by leaf and
    bud characteristics (Slee et al., 2015). Elevations in the transition zone, ~1550
    to 1650 m (depending on aspect and microclimate), contain trees with mixed subsp.
    pauciflora-subsp. niphophila leaf and bud characteristics (Figure 1b). Preliminary
    field surveys and visual observations showed strong elevation-dependent variation
    in forest decline and evidence of borer damage (Figure 1c,d) (Ward-Jones, 2020).
    Kosciuszko National Park is located within the Australian Alpine Bioregion and
    is dominated by a montane climate. As changing regional climate conditions are
    predicted to challenge subalpine communities, we describe regional warming via
    longitudinal records of maximum snow depth and snow cover from 1955 to 2020 for
    three sites differing in elevation within KNP (1430, 1620 and 1830 m) (https://www.snowyhydro.com.au/generation/live-data/snow-depths/).
    These records demonstrate persistent longitudinal reductions in the maximum depth
    of snow cover consistent across all elevations (-0.541 ± 0.174 cm year-1; Figure
    1e) and reductions in the duration of annual snow cover due to a progressively
    earlier end of the snow season (-0.373 ± 0.060 days year-1; Figure 1f). Longitudinal
    records of regional drought conditions for the study region were illustrated using
    the standardized precipitation-evapotranspiration index (SPEI) values obtained
    from the SPEI Global Drought Monitor (-36.25, 148.25, 1955-2020; Figure 1g, https://spei.csic.es;
    however, see also Appendix S1 Supplementary Methods and Figure S1). ^p Trait variation
    between subspecies and in response to elevation ^p Variation in twenty functional
    traits between subspecies was surveyed in 120 trees distributed along a single
    east-west elevation transect in the Perisher Valley, NSW, Australia (Appendix
    S1 Figure S2). Traits of ten healthy trees were surveyed at each of 12 sites spanning
    a total distance of ~31 km between 920 and 1930 m. Eucalyptus pauciflora subsp.
    pauciflora was surveyed across six sites (n = 60), and subsp. niphophila was surveyed
    across five sites (n = 50), with one site included in the subsp. transition zone
    (n = 10). At each site, ten living trees were selected by walking on contour and
    sampling at ~25 m intervals. Trees were geotagged and photographed to enable the
    cataloguing of traits for specific individuals over iterative field campaigns
    conducted within a 5-week period between late December 2021 and early January
    2022. ^p Traits surveyed captured variation across several above-ground organs,
    leaves, canopy branch stem tissues and the tree bole. Leaf and branch traits were
    characterized in tissues obtained from sun-exposed canopy branches up to 1 m long.
    Bole traits were determined at breast height in the largest stem.
  original_file: see raw data folder
  notes: none
