traits:
- var_in: satwc.leaf.dm
  unit_in: g/g
  trait_name: leaf_water_content_per_saturated_mass
  entity_type: individual
  value_type: raw
  basis_of_value: measurement
  replicates: 1
  methods: "Leaf traits were characterized in tissues obtained from sun-exposed canopy
    branches up to 1 m long. From each tree, pole pruners were used to sample sun-exposed
    canopy branches up to 1m long. Branches were transported back to the lab in dark
    plastic bags humidified with moistened paper. Upon returning to the lab branches
    were recut under water and allowed to rehydrate under dark conditions, before
    measurements were conducted. For each branch, mature leaf area and leaf mass per
    unit area were averaged from ten mature leaves measured using a leaf area meter
    (Li3100C, Li-COR Biosciences, Nebraska), and dry mass assessed after oven drying
    as above. Leaf saturated water content (SWCleaf; gwater g-1dry mass at 0MPa) and
    hydraulic capacitance (Cleaf; delta-gwater g-1dry mass MPa-1) were determined
    from one mature leaf from each individual by constructing pressure-volume curves,
    using the bench drying method (Tyree & Hammel, 1972; Bartlett et al., 2012). Leaf
    water potentials (psi-leaf) were measured using a Scholander pressure chamber
    (1050D, PMS Instrument Albany, USA) at intervals of 5 mg decline in fresh mass
    (XP 205 Metter Toledo balance, Mettler - Toledo - Ltd., Griefense, Switzerland).
    Similarly, stem saturated water content (SWCstem; gwater g-1dry mass at 0MPa)
    and hydraulic capacitance (Cstem; delta-gwater g-1dry mass MPa-1)were measured
    on 60cm terminal shoots. Upon returning to the lab, from each individual five
    short stem segments (3-4cm in length) of similar diameter (~0.6-1.1cm diameter)
    were cut from each individual with each segment containing at least three leaves.
    Segments were then bench dried for a duration sufficient to allow a decline water
    potential of 0.3 - 0.5 MPa. Before determination of stem fresh mass and wate potential,
    segments were placed in dark zip lock bags for >40 minutes to enable equilibration
    of water potentials within stem segments and with attached leaves. Stem fresh
    mass was then measured, and corresponding stem water potential determined from
    the average of two equilibrated leaves. Stem dry mass was then determined after
    oven drying as above. For both stems and leaves, hydraulic capacitance (C) was
    determined from the slope of the linear relationship between changing water content
    per unit dry mass per change in water potential (C = \U0001D6E5\U0001D44A\U0001D436
    /\U0001D6E5\U0001D6F9) and saturated water content (SWC; the tissue water content
    at 0MPa, estimated from the y-intercept of the linear relationship used to determine
    C (Bartlett et al., 2012; Bryant et al., 2021)."
- var_in: c.leaf.dm
  unit_in: g/g/MPa
  trait_name: leaf_capacitance
