- var_in: gmin.leaf
  unit_in: mmol{H2O}/m2/s
  trait_name: leaf_stomatal_conductance_per_area_ambient
  entity_type: individual
  value_type: minimum
  basis_of_value: measurement
  replicates: 1
  methods: Leaf - Minimum surface water vapour conductance; Leaf traits were characterized
    in tissues obtained from sun-exposed canopy branches up to 1 m long. From each
    tree, pole pruners were used to sample sun-exposed canopy branches up to 1m long.
    Branches were transported back to the lab in dark plastic bags humidified with
    moistened paper. Upon returning to the lab branches were recut under water and
    allowed to rehydrate under dark conditions, before measurements were conducted.
    Minimum leaf surface water vapour conductance (gmin leaf) was determined for one
    mature leaf per individual via the mass loss of detached leaves method (Kerstiens,
    1996; Duursma et al., 2019). In brief, petioles were sealed with petroleum jelly
    and then wrapped with para-film, and then leaves were suspended to dry in the
    lab with pedestal fans used to interrupt leaf boundary layers. Leaves were weighed
    at 45 min intervals. By plotting water loss versus time, cuticular transpiration
    was determined for the linear region (r2 > 0.995, from a minimum of 6 points per
    leaf) after initial stomatal closure. Temperature and relative humidity were measured
    at 10m intervals (BME280; Core Electronics) and logged with a microcontroller
    (Arduino MEGA 2560; Keyestudio). gmin was determined as the cuticular transpiration
    per two sided area per mole fraction difference in water vapour between leaf and
    air, where air inside the leaf was assumed saturated with water vapour (Pearcy
    et al., 2000).
- var_in: gmin.stem
  unit_in: mmol{H2O}/m2/s
  trait_name: .na
  entity_type: individual
  value_type: minimum
  basis_of_value: measurement
  replicates: 1
  methods: Branch - Stem Minimum surface water vapour conductance; Branch traits were
    characterized in tissues obtained from sun-exposed canopy branches up to 1 m long.
    From each tree, pole pruners were used to sample sun-exposed canopy branches up
    to 1m long. Branches were transported back to the lab in dark plastic bags humidified
    with moistened paper. Upon returning to the lab branches were recut under water
    and allowed to rehydrate under dark conditions, before measurements were conducted.
    Minimum stem surface water vapour conductance (gmin stem) was determined similarly,
    however on excised straight stem segments of ~10-15cm in length and ~0.7 - 1.1
    cm in diameter, with cut ends sealed with petroleum jelly and then wrapped with
    para-film (Wolfe, 2020).  Stem surface area was estimated as 2-pi-rh, with radius
    averaged from diameter measurements made at both ends of the segment.
  stem type: stem
