- var_in: wd.branch
  unit_in: g/cm3
  trait_name: wood_density
  entity_type: individual
  value_type: raw
  basis_of_value: measurement
  replicates: 1
  methods: Branch traits were characterized in tissues obtained from sun-exposed canopy
    branches up to 1 m long. Branch bark thickness (BTbranch) was determined by subtracting
    sapwood diameter from total branch diameter and dividing by two. Bark was then
    removed from ~3cm segment stem excised at the base of each branch, and sapwood
    volume and dry mass were measured as above, to determine branch sapwood density
    (WDbranch). From the base of each branch, a neighbouring 3cm segment was then
    placed in 30% ethanol for subsequent analyses of vessel and xylem property traits.
    DBH was measured as above. Bole bark thickness (BTbole) and bole relative bark
    thickness (RBTbole) were determined as above. Bole bark density was determined
    with aforementioned methods using full thickness bark sample, ~1.5 cm diameter.
    Bark samples excised at breast height using a bark knife were transport back to
    the lab wrapped in plastic film. Bole sapwood density (WDbole) was measured using
    1.5cm x 2mm micro cores sampled at breast height (Trephor, Belluno, Italy), then
    transported back to the lab in 1.5mL Eppendorf tubes moistened with 10µL of water.
  stem type: branch
