    70cm long branches with methods previously described (Pérez-Harguindeguy et al.,
    2013; Mencuccini et al., 2019). Briefly, all leaves were excised from branches,
    and total branch leaf areas were measured as above. Branch diameter was averaged
    from three triangulated measurements made with digital micrometer (5202, Shahe,
