- var_in: vessel.dens.branch
  unit_in: '{count}/mm2'
  trait_name: stem_vessel_density
  entity_type: individual
  value_type: raw
  basis_of_value: measurement
  replicates: 1
  methods: Vessel anatomy for each individual was determined in stem segments taken
    at the base of a 70cm terminal branch. From each segment 4-5 cross sections (~70
    µm thick) were made using a sledge microtome (GSL 1, S. Luccinetti, Schenkung
    Dapples, Zürich, Switzerland). Sections were stained for 10s with toluidine (0.01%
    wt/vol) then micrographed at 40X using a light microscope (Axiostar plus, Zeiss,
    Germany) equipped with a digital camera (MD500, The Logical Interface, Illawong,
    NSW, Australia). Xylem vessel density (vessel n mm-2) and vessel lumen areas,
    were surveyed in 497 ± 152 vessels per individual, images were analysed with ImageJ
    (Schneider et al., 2012). Vessel diameters were estimated using vessel lumen areas
    to determine diameter of an equivalent circle. Lumen fraction (mm2 mm-2) and fibre
    fractions (1-lumen fraction) were calculated by dividing the total xylem lumen
    area by the total area of section. Fibre density (g cm-3) was determined by dividing
    sapwood density (g cm-3) by the fibre fractional area. Hydraulically weighted
    mean vessel diameters (Dh) were calculated as previously described (Tyree & Zimmermann,
    1971; Steppe & Lemeur, 2007), and used with the Hagan-Poiseuille equation to calculate
    the hydraulic conductivity of a mean vessel (Kv; mg m s-1 MPa-1).
