    water content (SWC; the tissue water content at 0MPa, estimated from the y-intercept
    of the linear relationship used to determine C (Bartlett et al., 2012; Bryant
    et al., 2021). Hydraulically weighted mean vessel diameters (Dh) were calculated
    as previously described (Tyree & Zimmermann, 1971; Steppe & Lemeur, 2007), and
    used with the Hagan-Poiseuille equation to calculate the hydraulic conductivity
    of a mean vessel (Kv; mg m s-1 MPa-1)."
